import React from 'react'
import Card from 'react-bootstrap/Card'
import Button from 'react-boot'
class FavoriteCards extends React.Component {

    render () {
        return (
          <div>
           <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>{this.props.school.School_name}</Card.Title>
                    <Card.Text>{this.props.school.description}</Card.Text>
                    <Button variant="primary">Applay</Button>
                </Card.Body>
            </Card>
          </div>
        )
    }

}
export default FavoriteCards
